import styled from 'styled-components';
import Layout from 'components/Layout';

const NavWrapper = styled(Layout)`
  div {
    display: block;
    font-size: 1.6rem;
    padding: .4rem 0;
    border-radius: 5px;
    background: #F3F5FC;
    padding: .8rem;
    margin-bottom: 1rem;
  }
  .bankee div {
    background: #C3B0F7;
  }
  .lexion div {
    background: #FAEBD7;
  }
  .vj div {
    background: #98FB98;
  }
`;

export default NavWrapper;
